Javanen wonen voornamelijk op het eiland Java in Indonesië en in de buurlanden van Indonesië zoals Maleisië, Singapore, Hongkong, Taiwan. Anderen zijn uitgeweken naar Suriname en Nieuw-Caledonië. Er wonen ook Javanen in Europa waaronder Nederland. Een Javaan is iemand die 
* afkomstig is van Midden- of Oost-Java (orang Jawa; wang Jawa; wong Jawa; tiyang Jawi) of ruimer gezien van Javaanse afkomst is (Jawa asli); 
* het Javaans als moedertaal heeft: Zie Javaans voor het hoofdartikel over dit onderwerp.

